import {gray, white, red} from 'open-color'

export const COLOR = {
    primary : {
        background: gray[9],
        color: white
    },
    warnning : {
        background: red[5],
        color: white
    },
    mono : {
        background: gray[2],
        color: gray[9]
    },

}
